import React, { useEffect, useState } from 'react'

function NavBar() {
 const modeIconStyle = {
    fontFamily: "FontAwesome" // Ensure FontAwesome is the actual name of the font
};
  return (
    <nav id="nav" class="bottom-shadow navbar navbar-expand-lg bg-body-tertiary position-sticky light bg-white">
            <div class="container">
              <h1 id="logo" class="navbar-brand mid-bold light">Where in the world?</h1>
              <div class="mode d-flex align-items-center gap-1">
                <button type="button" class="btn light" id="mode-btn"><i id="mode-icone" class="mx-2 mode-icone fa fa-moon-o" aria-hidden="true"  style={modeIconStyle}></i>Dark Mode</button>
            </div>
            </div>
    </nav>
  );
}

export default NavBar;
